  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The National Impact Assessment of the
  Centers for Medicare and Medicaid Services (CMS) Quality Measures Reports (Impact
  Reports) are mandated by section 3014(b), as amended by section 10304, of the Patient
  Protection and Affordable Care Act (ACA), which provides that the Secretary shall,
  not later than March 1, 2012, and at least once every three years thereafter, conduct
  an assessment of the quality and efficiency impact of the use of endorsed measures
  described in section 1870(b)(7)(B) of the Social Security Act and make such assessment
  available to the public. The reports provide a quality check to determine if CMS
  is making progress on the healthcare delivery system to achieve the three aims of
  better care, smarter spending, and healthier people.</p>n\",\n\t\"license_title\":
